import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';

import ProjectPreview from "./ProjectPreview"

import NavBar from "./NavBar"

function App() {
  return (
    <Router>
      <div>

        <Route exact path="/" component={Home} />
      </div>
    </Router>

  );
}

function Home() {
  return (
    <div>
      <Home/>
    </div>);
}

export default App;
